// define dependencies. Can be omitted
// don't worry, deps will not be a global variable, similar to require variable in nodejs
deps = [{
		amd: 'lodash',
		common: '!_',
		node: 'lodash'
	},
	'./examples/some-module',
	'./examples/html-template',
	'./examples/jquery-ui',
	'./examples/react-in-coffee',
	'./examples/react-in-js'
];

/**
 * factory is called with dependencies as arguments
 * the return of the function is what the module exposes
 * take a look at some-module.js as an example
 * 
 * in commonjs mode, since modules are already loaded, dependencies will be executed in order of requirement.
 * i.e html-template then jquery-ui then react-in-coffee and finally react-in-js
 * in amd mode, dependencies will be executed when loaded, therefore, the order is not guaranteed
 * but, in any case, factory will only be executed when all needed files are loaded
 */
function factory(_, lib) {
	var span;
	span = document.createElement('span');
	span.innerHTML = lib.hell;
	document.body.appendChild(span);
	span = null;
	console.log('application', lib.hell);
}